import React, { Component } from 'react';
import { observer, inject } from 'mobx-react'

@observer
@inject('productsStore', 'cartStore')
class Cart extends Component {

    render() {
        const { cartStore } = this.props;
        return (
            <div>
                <h2>Cart</h2>
                <ul>
                    {
                        cartStore.items.map(item => {
                            <li key={ item.id }>

                            </li>
                        })
                    }
                </ul>
            </div>
        );
    }
}

export default Cart;
